    .form-control, .form-select {
        padding: 5px 12px;
        font-size: 14px;
        line-height: 20px;
        color: var(--color-fg-default);
        vertical-align: middle;
        background-color: var(--color-canvas-default);
        background-repeat: no-repeat;
        background-position: right 8px center;
        border: 1px solid var(--color-border-default);
        border-radius: 6px;
        outline: none;
        box-shadow: var(--color-primer-shadow-inset)
    }

    .input-contrast {
        background-color: var(--color-canvas-inset)
    }

    .subnav-search {
        position: relative;
        flex: auto;
        display: flex
    }

    .subnav-search-input {
        flex: auto;
        padding-left: 32px;
        color: var(--color-fg-muted)
    }

    .subnav-search-icon {
        position: absolute;
        top: 9px;
        left: 8px;
        display: block;
        color: var(--color-fg-muted);
        text-align: center;
        pointer-events: none
    }

    .subnav-search-context + .subnav-search {
        margin-left: -1px
    }

    .subnav-item {
        flex: none;
        position: relative;
        float: left;
        padding: 5px 10px;
        font-weight: 500;
        line-height: 20px;
        color: var(--color-fg-default);
        border: 1px solid var(--color-border-default)
    }

    .subnav-item:hover {
        background-color: var(--color-canvas-subtle)
    }

    .subnav-item:first-child {
        border-top-left-radius: 6px;
        border-bottom-left-radius: 6px
    }

    .subnav-item:last-child {
        border-top-right-radius: 6px;
        border-bottom-right-radius: 6px
    }

    .subnav-item + .subnav-item {
        margin-left: -1px
    }

    .counter {
        display: inline-block;
        min-width: 20px;
        padding: 0 6px;
        font-size: 12px;
        font-weight: 500;
        line-height: 18px;
        color: var(--color-fg-default);
        text-align: center;
        background-color: var(--color-neutral-muted);
        border: 1px solid transparent;
        border-radius: 2em
    }

    .color-icon-success {
        color: var(--color-success-fg) !important
    }

    .color-text-danger {
        color: var(--color-danger-fg) !important
    }

    .color-text-warning {
        color: var(--color-checks-step-warning-text) !important
    }

    .color-fg-muted {
        color: var(--color-fg-muted) !important
    }

    .octicon {
        display: inline-block;
        overflow: visible !important;
        vertical-align: text-bottom;
        fill: currentColor;
        margin-right: 7px;
        flex: none
    }

    @media only screen and (max-width: 600px) {
        .subnav-item, .form-control {
            border-radius: 0 !important
        }

        .subnav-item {
            padding: 5px 3px;
            border: none
        }

        .subnav-search-input {
            border-left: 0;
            border-right: 0
        }
    }

    .header-view-status-container {
        float: right
    }

    @media only screen and (max-width: 600px) {
        .header-view-status-container {
            float: none;
            margin: 0 0 10px !important;
            overflow: hidden
        }

        .header-view-status-container .subnav-search-input {
            border-left: none;
            border-right: none
        }
    }

    .tree-item {
        text-overflow: ellipsis;
        overflow: hidden;
        white-space: nowrap;
        line-height: 38px
    }

    .tree-item-title {
        cursor: pointer
    }

    .tree-item-body {
        min-height: 18px
    }

    .label {
        display: inline-block;
        padding: 0 8px;
        font-size: 12px;
        font-weight: 500;
        line-height: 18px;
        border: 1px solid transparent;
        border-radius: 2em;
        background-color: var(--color-scale-gray-4);
        color: #fff;
        margin: 0 10px;
        flex: none;
        font-weight: 600
    }

    @media (prefers-color-scheme: light) {
        .label-color-0 {
            background-color: var(--color-scale-blue-0);
            color: var(--color-scale-blue-6);
            border: 1px solid var(--color-scale-blue-4)
        }
